import React, { Component } from "react";
import '../../App.css';
import LeftDrawer from '../Drawer/Drawer';
import * as styles from  "../../styles/settings";
import * as inputStyles from "../../styles/inputField";
import * as buttonStyles from "../../styles/button";
import axios from 'axios';
import { connect } from "react-redux";

class Settings extends Component {

    constructor(props){
        super(props); 
        
              
    }
    componentDidMount(){
      
    }
    render() {
   

        return (
        <div  >
         
           
          
            <LeftDrawer></LeftDrawer>
            <p style={styles.labelsOne}>
                Notification Settings
            </p>
            <form>
                <input type="checkbox" value="email-alert" id="email-alert" style={styles.checkbox}></input> 
                <label for="email-alert" style={styles.labelsTwo}>Send Email Alert</label>
                    <p style={styles.labelsThree}>Primary Email: <input type="email" style={inputStyles.settingsInput} name="email" ></input> <button style={buttonStyles.addButton}>+</button></p>
                <input type="checkbox" value="mobile-alert" id="mobile-alert" style={styles.checkbox}></input> 
                <label for="mobile-alert" style={styles.labelsTwo}>Send Mobile Alert</label>
                    <p style={styles.labelsFour}>Primary Mobile: <input type="tel" style={inputStyles.settingsInput} name="mobile" ></input> <button style={buttonStyles.addButton}>+</button></p>
            <button type="submit" style={buttonStyles.searchButton} >Update</button>
            </form>
        </div> 

        );
    }
}


const mapStateToProps = state =>{
   
    return {
        
     }
}

const mapDispatchStateToProps = dispatch => {
    return {
        surveillance : () => {
            axios.get('http://localhost:3001/live-surveillance').then(response=>{
                console.log(response);
                dispatch({type: "surveillance",payload : response.data})
            })
                    
            
        }
    }
}

export default (connect(mapStateToProps,mapDispatchStateToProps)(Settings));
